window.bookSummaryJSON = "<p>Book 11 of the Demon Accords. </p> <p>Las Vegas. Sin City. What happens in Vegas...could kill most of the human race. </p> <p>When all trails lead Chris, Tanya, and their entire team to the desert gambling mecca, the stakes become the highest possible. Facing a hybrid demon werewolf, his death witch mother, undead strippers, and pregnancy cravings, Chris must rely on his team like never before if he's to have any chance at saving the race of man, not to mention a spot in preschool for his unborn kids. </p>"; 
